    { title: "Category", field: "category" },
    { title: "Price", field: "price", type: "numeric" },
    { title: "Offer Price", field: "offer_price", type: "numeric" },
    { title: "Photo", field: "photo" },
    { title: "Created At", field: "created_at" },
    { title: "Status", field: "status" },
    { title: "Created By", field: "created_by" },
  ]);

  useEffect(() => {
    functionData();
  }, [productData]);
  console.log(productData);

  const functionData = () => {
    axios.get("https://groceryshop-api.herokuapp.com/api/product").then((res) => {
      setProductData(res.data.data);
    });
    // fetch("https://groceryshop-api.herokuapp.com/api/product").then((req) => {
    //   req.json().then((result) => {
    //     setProductData(result.data);
    //     console.log(productData);
    //   });
    // });
  };

  return (
    <>
      <MaterialTable columns={columns} data={productData} />;
    </>
  );
}

export default Product;
